import { IStringParser } from '../IStringParser';
import { Graph } from '../../models';
import { NamedVertex } from '../../models';
import { DirectedEdge } from '../../models';

// This parser is very rudimental and assumes alot
export class SimpleGDFParser implements IStringParser<Graph<NamedVertex, DirectedEdge<NamedVertex>>> {
    currentMode: 'none' | 'nodedef' | 'edgedef' = 'none';
    lines: string[] = [];
    currentGraph: Graph<any, any> = new Graph<NamedVertex, DirectedEdge<NamedVertex>>();

    parse(input: string): Graph<NamedVertex, DirectedEdge<NamedVertex>> {
        this.read(input);
        while (this.lines.length > 0) {
            this.parseNextStep();
        }

        return this.currentGraph.copy();
    }

    parseNextStep(): Graph<any, any> | null {
        const nextLine = this.lines.shift();
        if (nextLine === undefined) {
            return null;
        }

        if (nextLine.startsWith('nodedef')) {
            this.currentMode = 'nodedef';
            return this.parseNextStep();
        }

        if (nextLine.startsWith('edgedef')) {
            this.currentMode = 'edgedef';
            return this.parseNextStep();
        }

        if (this.currentMode === 'nodedef') {
            const vertexName = nextLine.trim();
            this.currentGraph.addVertex(new NamedVertex(vertexName));
        }

        if (this.currentMode === 'edgedef') {
            const [vertexNameA, vertexNameB] = nextLine.split(',');
            this.currentGraph.addEdge(new DirectedEdge(new NamedVertex(vertexNameA), new NamedVertex(vertexNameB)));
        }

        return this.currentGraph.copy();
    }

    read(input: string): boolean {
        this.lines = input.split('\n');

        return true;
    }
}

export default SimpleGDFParser;

import { Vertex } from '../Vertex/Vertex/Vertex';
import { MutableHashMap } from '@tgillespie/hash-data-structures';
import { Edge } from '../Edge';

export class AdjacencyList<V extends Vertex> {
    protected _adjacencyList: MutableHashMap<V, V[]>;

    constructor() {
        this._adjacencyList = new MutableHashMap<V, V[]>();
    }

    areAdjacent(from: V, to: V): boolean {
        return this.getAdjacentVertices(from).find((singleVertex) => singleVertex.equals(to)) !== undefined;
    }

    getAdjacentVertices(vertex: V): V[] {
        return this._adjacencyList.get(vertex) ?? [];
    }

    addAdjacency(vertexA: V, vertexB: V): void {
        if (this.areAdjacent(vertexA, vertexB)) return;
        this._adjacencyList.set(vertexA, [...this.getAdjacentVertices(vertexA), vertexB]);
        this._adjacencyList.set(vertexB, [...this.getAdjacentVertices(vertexB), vertexA]);
    }

    deleteVertex(vertex: V): void {
        this._adjacencyList.delete(vertex);
        for (const [key, value] of this._adjacencyList.entries()) {
            this._adjacencyList.set(
                key,
                value.filter((x) => !x.equals(vertex))
            );
        }
    }

    deleteEdge(edge: Edge<V>): void {
        const vertexAList = this._adjacencyList.get(edge.vertexA) ?? [];
        const newVertexAList = vertexAList.filter((x) => !x.equals(edge.vertexB));
        if (newVertexAList.length > 0) {
            this._adjacencyList.set(edge.vertexA, newVertexAList);
        } else {
            this._adjacencyList.delete(edge.vertexA);
        }

        // Because it is about adjacency it must be done for both directed and undirected edges
        const vertexBList = this._adjacencyList.get(edge.vertexB) ?? [];
        const newVertexBList = vertexBList.filter((x) => !x.equals(edge.vertexA));
        if (newVertexBList.length > 0) {
            this._adjacencyList.set(edge.vertexB, newVertexBList);
        } else {
            this._adjacencyList.delete(edge.vertexB);
        }
    }
}

