            const weightedEdge1 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 0);
            // Second one to make sure it is not looking at the instance
            const weightedEdge2 = new WeightedDirectedEdge(new NamedVertex('b'), new NamedVertex('a'), 0);

            expect(weightedEdge1.equals(weightedEdge2)).toEqual(false);
            expect(weightedEdge2.equals(weightedEdge1)).toEqual(false);
        });

        it('returns true for itself', () => {
            const weightedEdge1 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 0);
            // Second one to make sure it is not looking at the instance
            const weightedEdge2 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 0);

            expect(weightedEdge1.equals(weightedEdge2)).toEqual(true);
            expect(weightedEdge2.equals(weightedEdge1)).toEqual(true);
        });

        it('returns false when the _type is changed', () => {
            const weightedEdge1 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 0);
            const weightedEdge2 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 0);
            weightedEdge2['_type'] = 'SomethingElse';

            expect(weightedEdge1.equals(weightedEdge2)).toEqual(false);
            expect(weightedEdge2.equals(weightedEdge1)).toEqual(false);
        });
    });

    describe('hashCode()', () => {
        it('differs from the DirectedEdge with weight of 0', () => {
            const weightedEdge = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 0);
            const edge = new DirectedEdge(new NamedVertex('a'), new NamedVertex('b'));

            expect(weightedEdge.hashCode()).not.toEqual(edge.hashCode());
        });

        it('differs for the same vertices but different weights', () => {
            const weightedEdge1 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 0);
            const weightedEdge2 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 1);

            expect(weightedEdge1.hashCode()).not.toEqual(weightedEdge2.hashCode());
        });

        it('is the same for the same inputs', () => {
            const weightedEdge1 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 15);
            const weightedEdge2 = new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 15);

            expect(weightedEdge1.hashCode()).toEqual(weightedEdge2.hashCode());
        });
    });

    it('holds hashable contract', () => {
        new ContractVerifier([
            new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('b'), 0),
            new WeightedDirectedEdge(new NamedVertex('b'), new NamedVertex('a'), 456),
            new WeightedDirectedEdge(new NamedVertex('b'), new NamedVertex('a'), 456),
            new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('a'), 48),
            new WeightedDirectedEdge(new NamedVertex(' a'), new NamedVertex('a'), 0),
            new WeightedDirectedEdge(new NamedVertex('a '), new NamedVertex('a'), -156),
            new WeightedDirectedEdge(new NamedVertex(' a '), new NamedVertex('a'), -156),
            new WeightedDirectedEdge(new NamedVertex('a a'), new NamedVertex('a'), -156),
            new WeightedDirectedEdge(new NamedVertex('a '), new NamedVertex('a '), -156),
            new WeightedDirectedEdge(new NamedVertex('b'), new NamedVertex('b'), 0),
            new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex('a'), 0),
            new WeightedDirectedEdge(new NamedVertex('{'), new NamedVertex('}'), 1),
            new WeightedDirectedEdge(new NamedVertex('}'), new NamedVertex('{'), 2),
            new WeightedDirectedEdge(new NamedVertex('longer'), new NamedVertex('name'), -1),
            new WeightedDirectedEdge(new NamedVertex('glfuenegufelg'), new NamedVertex('unafgelgfengfunlegf'), 4564),
            new WeightedDirectedEdge(new NamedVertex(''), new NamedVertex(''), 48497498897),
            new WeightedDirectedEdge(new NamedVertex('a'), new NamedVertex(''), -4894948),
            new WeightedDirectedEdge(new NamedVertex(''), new NamedVertex('nfgeuved'), 4548),
            new DirectedEdge(new NamedVertex('a'), new NamedVertex('b')),
        ]).verifyContract();
    });
});

import { Graph } from '../Graph';
import { DirectedEdge } from '../../Edge';
import {
    generateDirectedEdgesWithNameVertex,
    generateNamedVertices,
} from '../../../../testUtil/generationFromSimplerDatastructure';
import { NamedVertex } from '../../Vertex/NamedVertex/NamedVertex';
import { expectVerticesListsAreEqual } from '../../../../testUtil/expectVerticesListsAreEqual';
import { expectEdgeListsAreEqual } from '../../../../testUtil/expectEdgeListsAreEqual';

describe('graph.deleteVertex(v)', () => {
    let graph: Graph<NamedVertex, DirectedEdge<NamedVertex>>;
    const vertices = ['a', 'b', 'c', 'd'];
    const edges = [
        ['a', 'b'],
        ['b', 'c'],
        ['a', 'c'],
    ];

    beforeEach(() => {
        graph = new Graph(false);
        graph.addVertex(...generateNamedVertices(vertices));
        graph.addEdge(...generateDirectedEdgesWithNameVertex(edges));
    });

    it('graph is initially as expected', () => {
        // list of vertices
        expectVerticesListsAreEqual(generateNamedVertices(vertices), graph.getListOfVertices());

        // list of edges
        expectEdgeListsAreEqual(generateDirectedEdgesWithNameVertex(edges), graph.getListOfEdges());

        // (sparse) adjacency matrix
        for (const vertexA of generateNamedVertices(vertices)) {
            for (const vertexB of generateNamedVertices(vertices)) {
                if (edges.filter((x) => x[0] === vertexA.name && x[1] === vertexB.name).length === 0) {
                    expect(graph.getAdjacencyMatrix().get(vertexA, vertexB)).toBe(false);
                } else {
                    expect(graph.getAdjacencyMatrix().get(vertexA, vertexB)).toBe(true);
                }
            }
        }

        // adjacency list
        const adjacencyList = graph.getAdjacencyList();
        expectVerticesListsAreEqual(
            adjacencyList.getAdjacentVertices(new NamedVertex('a')),
            generateNamedVertices(['b', 'c'])
        );
        expectVerticesListsAreEqual(
            adjacencyList.getAdjacentVertices(new NamedVertex('b')),
            generateNamedVertices(['a', 'c'])
        );
        expectVerticesListsAreEqual(
            adjacencyList.getAdjacentVertices(new NamedVertex('c')),
            generateNamedVertices(['a', 'b'])
        );
        expectVerticesListsAreEqual(adjacencyList.getAdjacentVertices(new NamedVertex('d')), []);
    });

    describe('vertex list is correct', () => {
        it.each(vertices)('removes the vertex %s from the vertex list', (input) => {
            graph.deleteVertex(new NamedVertex(input));
            expect(graph.getListOfVertices().length).toBe(3);
            expect(graph.getListOfVertices()).toEqual(generateNamedVertices(vertices).filter((x) => x.name !== input));
        });
    });

    describe('edge list is correct', () => {
        it.each(['a', 'b', 'c'])('removes the vertex %s and receives the correct edge count', (input) => {
            graph.deleteVertex(new NamedVertex(input));
            expect(graph.getListOfEdges().length).toBe(1);
        });

        it('removes the vertex d and receives the correct edge count', () => {
            graph.deleteVertex(new NamedVertex('d'));
            expect(graph.getListOfEdges().length).toBe(3);
        });

        it.each(vertices)('removes the vertex %s and no edge contains the vertex anymore', (input) => {
            const removeVertex = new NamedVertex(input);
            graph.deleteVertex(removeVertex);
            expect(
                graph.getListOfEdges().some((x) => x.vertexA.equals(removeVertex) || x.vertexB.equals(removeVertex))
            ).toBe(false);
        });
    });

    describe('adjacencyList is correct', () => {
        it.each(vertices)('removes the vertex %s and finds an empty list (default) for that vertex', (input) => {
            const removedVertex = new NamedVertex(input);
            graph.deleteVertex(removedVertex);
            expect(graph.getAdjacencyList().getAdjacentVertices(removedVertex).length).toBe(0);
        });

        it.each(vertices)('removes the vertex %s and does not find it in other adjacency lists', (input) => {
            const removedVertex = new NamedVertex(input);
            graph.deleteVertex(removedVertex);
            for (const maybeAdjacentToRemoved of generateNamedVertices(vertices)) {
                expect(
                    graph
                        .getAdjacencyList()
                        .getAdjacentVertices(maybeAdjacentToRemoved)
                        .filter((x) => x.equals(input)).length
                ).toBe(0);
            }
        });
    });

    describe('adjacencyMatrix is correct', () => {
        it.each(['a', 'b', 'c', 'd'])(
            'removes the vertex %s and the matrix shows false for whenever %s is the first value',
            (input) => {
                const removedVertex = new NamedVertex(input);
                graph.deleteVertex(removedVertex);
                for (const singleVertex of vertices) {
                    expect(graph.getAdjacencyMatrix().get(removedVertex, new NamedVertex(singleVertex))).toBe(false);
                }
            }
        );

        it.each(['a', 'b', 'c', 'd'])(
            'removes the vertex %s and the matrix shows false for whenever %s is the second value',
            (input) => {
                const removedVertex = new NamedVertex(input);
                graph.deleteVertex(removedVertex);
                for (const singleVertex of vertices) {
                    expect(graph.getAdjacencyMatrix().get(new NamedVertex(singleVertex), removedVertex)).toBe(false);
                }
            }
        );

        it.each(['a', 'b', 'c', 'd'])(
            'removes the vertex %s and adjacencies not related to that node are still the same',
            (input) => {
                const removedVertex = new NamedVertex(input);
                graph.deleteVertex(removedVertex);
                const verticesWithoutRemoved = generateNamedVertices(vertices.filter((x) => x !== input));
                for (const vertexA of verticesWithoutRemoved) {
                    for (const vertexB of verticesWithoutRemoved) {
                        if (edges.filter((x) => x[0] === vertexA.name && x[1] === vertexB.name).length === 0) {
                            expect(graph.getAdjacencyMatrix().get(vertexA, vertexB)).toBe(false);
                        } else {
                            expect(graph.getAdjacencyMatrix().get(vertexA, vertexB)).toBe(true);
                        }
                    }
                }
            }
        );
    });
});

import { NamedVertex } from '../Vertex/NamedVertex/NamedVertex';
import { AdjacencyList } from './AdjacencyList';
import { DirectedEdge, UndirectedEdge } from '../Edge';

const a = new NamedVertex('a');
const b = new NamedVertex('b');
const c = new NamedVertex('c');
const d = new NamedVertex('d');
let adjList: AdjacencyList<NamedVertex>;

describe('AdjacencyList', () => {
    beforeEach(() => {
        adjList = new AdjacencyList();
    });

    it('two different vertices are initially not adjacent', () => {
        adjList.areAdjacent(a, b);
    });

    it.each([a, b])('a vertex is not adjacent to itself initially: NamedVertex %s', (vertex) => {
        expect(adjList.areAdjacent(vertex, vertex)).toBe(false);
    });

    it('adding adjacency will make the same vertices in the same order adjacent', () => {
        const list = new AdjacencyList();
        list.addAdjacency(a, b);
        expect(list.areAdjacent(a, b)).toBe(true);
    });

    it('adding adjacency will make the same vertices in the reverse order adjacent', () => {
        adjList.addAdjacency(a, b);
        expect(adjList.areAdjacent(b, a)).toBe(true);
    });

    it('adding an adjacency twice will make the same vertices in the same order adjacent', () => {
        adjList.addAdjacency(a, b);
        adjList.addAdjacency(a, b);
        expect(adjList.areAdjacent(a, b)).toBe(true);
    });

    it('adding an adjacency twice will make the same vertices in the same reverse adjacent', () => {
        adjList.addAdjacency(a, b);
        adjList.addAdjacency(a, b);
        expect(adjList.areAdjacent(b, a)).toBe(true);
    });

    it('adding an adjacency once in both orders will make the same vertices in the same reverse adjacent', () => {
        adjList.addAdjacency(a, b);
        adjList.addAdjacency(b, a);
        expect(adjList.areAdjacent(b, a)).toBe(true);
    });

    it('adding adjacency and then a vertex it will make the same vertices in the same order not adjacent', () => {
        adjList.addAdjacency(a, b);
        adjList.deleteVertex(a);
        expect(adjList.areAdjacent(a, b)).toBe(false);
    });

    it('adding adjacency and then deleting a vertex it will make the same vertices in the reverse order not adjacent', () => {
        adjList.addAdjacency(a, b);
        adjList.deleteVertex(a);
        expect(adjList.areAdjacent(b, a)).toBe(false);
    });

    it('adding an adjacency twice and then deleting a vertex it will make the same vertices in the same order not adjacent', () => {
        adjList.addAdjacency(a, b);
        adjList.addAdjacency(a, b);
        adjList.deleteVertex(a);
        expect(adjList.areAdjacent(a, b)).toBe(false);
    });

    it('adding adjacency and then deleting a vertex twice it will make the same vertices in the reverse order not adjacent', () => {
        adjList.addAdjacency(a, b);
        adjList.addAdjacency(a, b);
        adjList.deleteVertex(a);
        adjList.deleteVertex(a);
        expect(adjList.areAdjacent(b, a)).toBe(false);
    });

    it('adding adjacency and then deleting a vertex twice it will make the same vertices in the same order not adjacent', () => {
        adjList.addAdjacency(a, b);
        adjList.deleteVertex(a);
        adjList.deleteVertex(a);
        expect(adjList.areAdjacent(a, b)).toBe(false);
    });

    it('deleting a not listed vertex works', () => {
        adjList.deleteVertex(a);
        expect(adjList.areAdjacent(a, b)).toBe(false);
    });

    it('deleting a not listed vertex does not affect other adjacency', () => {
        adjList.addAdjacency(c, d);
        adjList.deleteVertex(a);
        expect(adjList.areAdjacent(c, d)).toBe(true);
    });

    it('deleting a vertex does not affect other adjacency', () => {
        adjList.addAdjacency(a, b);
        adjList.addAdjacency(b, c);
        adjList.addAdjacency(c, d);
        adjList.deleteVertex(a);
        expect(adjList.areAdjacent(a, b)).toBe(false);
        expect(adjList.areAdjacent(b, c)).toBe(true);
        expect(adjList.areAdjacent(c, d)).toBe(true);
    });

    it('deleting a directed edge deletes the corresponding adjacency', () => {
        adjList.addAdjacency(a, b);
        adjList.deleteEdge(new DirectedEdge(a, b));
        expect(adjList.areAdjacent(a, b)).toBe(false);
    });

    it('deleting a directed edge deletes does not delete other adjacencies', () => {
        adjList.addAdjacency(a, b);
        adjList.addAdjacency(a, c);
        adjList.addAdjacency(b, c);
        adjList.addAdjacency(c, d);
        adjList.deleteEdge(new DirectedEdge(a, b));
        expect(adjList.areAdjacent(a, c)).toBe(true);
        expect(adjList.areAdjacent(b, c)).toBe(true);
        expect(adjList.areAdjacent(c, d)).toBe(true);
    });

    it('deleting an undirected edge deletes the corresponding adjacency', () => {
        adjList.addAdjacency(a, b);
        adjList.deleteEdge(new UndirectedEdge(a, b));
        expect(adjList.areAdjacent(a, b)).toBe(false);
    });

    it('deleting an undirected edge deletes does not delete other adjacencies', () => {
        adjList.addAdjacency(a, c);
        adjList.addAdjacency(b, c);
        adjList.addAdjacency(c, d);
        adjList.deleteEdge(new UndirectedEdge(a, b));
        expect(adjList.areAdjacent(a, b)).toBe(false);
        expect(adjList.areAdjacent(a, c)).toBe(true);
        expect(adjList.areAdjacent(b, c)).toBe(true);
        expect(adjList.areAdjacent(c, d)).toBe(true);
    });

    it('deleting an edge of non-existent vertices does not change the adjacency list', () => {
        adjList.addAdjacency(a, b);
        adjList.addAdjacency(a, c);
        adjList.addAdjacency(b, c);
        adjList.addAdjacency(c, d);
        adjList.deleteEdge(new DirectedEdge(a, b));
        expect(adjList.areAdjacent(a, c)).toBe(true);
        expect(adjList.areAdjacent(b, c)).toBe(true);
        expect(adjList.areAdjacent(c, d)).toBe(true);
    });
});

